VALUES ('8004333000234', 'Praline iz temne čokolade z polnilom likerja in češnje', 'IT) Cioccolatino di Cioccolato ExtraFondente (Caçao: 50% minimo) con Ciliegia e Liquore. Ingredienti; zucchero, pasta di cacao, liquore 27% (zucchero, sciroppo di zucchero invertito, acqua, aroma Maraschino). aliegia in alcool denocciolata 10%, burro di cacao, emulsionante: lecitina di soia; aroma. Può contenere tracce di frutta a guscio, latte e cereali contenenti glutine.  GB) Dark Chocolate Praline (cocoa solids 50% minimum) with Cherry and Liqueur Filling. Ingredients; sugar, cocoa mass, liqueur 27% (sugar, invert sugar syrup, water, Maraschino flavouring), pitted cherry in alcohol 10%, çocoa buttėr, emulsifier: soya lecithin; flayouring May contain traces of nuts, milk and cereals containing gluten.  SI) Praline iz Temne Cokolade (kakavovi deli: najmanj 50 %) z Polnilom iz Likerja in Cešnje. Sestavine: sladkor, kakavOva masa, liker 279% sladkor, sirup iz invertnega sladkorja, voda, aroma Maraskin), česnja brez koščice v alkoholu 10%, kakavovo maslo, emulgator: sojin lecitin; aroma. Vsebnost alkohola 2,9%.Zivilo ni primerno za otroke. Izdelek lahko ysebuje mleko, orešcke in žita, ki vsebujejo gluten. Za slovenski trg važa in distribuira: BIMO d.o.o Savska loka 21B, 4000 Kranj, tel.: 04/231-14-22, www.bimo.si  HR) Praline od tamne čokolade (kakao dijelovi: najmanje 50%) s punilom od likera i češnje. Sastojci: šećer, kakao masa, liker 27% (šećer, sirup invertnog secera, võda, aroma Maraşkin, češnje bez koštica u alkohóly 10%, kakao maslac, emulgator: sojin lecitin; aroma. Alkohol 2,9%. Proizvod može sádržavati mlijeko, orašaste plodove i zitarice, köje sadržavaju gluten. Za hrvaški trg uyaža in distribuira: BIMO ADRIATIC d.o0, Radnička cesta 39, HR-10000 Zagreb  GR) Mauph npaiva σοκολάτάς (στερεά κακάου: 50% τουλάχιστον) με γέμιση κεράσι καιλικέρ. Συστατικά: ζάχαρη, κάκαομαζα λικέρ 276 (aaρn, σιρόπιμβερτοποιημένης ζάχαρης νέρό, άρωματική ύλη Μάρασκίνο), κεράσι χωρίς κουκούτσί σε ακοόλ 106, βούτυρο κακάου, γαλακτωματοποιήτής: λεκιθίνη, σόγιας, άρωμα . Μπορεί να περιέγει ηνη καρποίμε κέλυφος γάλα και δημήτριακά που περίέγουν γλουτένη', 'https://static.openfoodfacts.org/images/products/800/433/300/0234/front_sl.4.400.jpg', '20', '12', '59', '53', '', '3.5', '0.01', '0.00393700787401575', '2.9', '0');

