VALUES ('8004970134736', 'Dalcolle pandoro crema chantilly', 'Farine de blé, Oeufs, Beurre (lait), sucre, Crème Chantilly 1 0% (Sucre, Sirop de glucose, Eau, Lait en poudre, Beurre (lait), Jaune d\'oeufs, Stabilisateur: pectine, Amidon de riz, Conservateur: sorbate de potassium, Arômes), Eau, Levain naturel (blé), Sirop de glucose, Emulsifiant: mono-diglycérides dacides gras, Sel, Lait écrémé en poudre, Beurre de cacao, Arômes, Conservateur: acide sorbique. Peut contenir trêces de arachides, fruits à coque, sésame et soja. Contient un sachet de sucre glace (Ingrédients: Sucre, Amidon de blé, Arômes: vanilline), que c\'est partie intégrante du produit. (D) NATÜRLICHER HEFEKUCHEN MIT FÜLLUNG - ZUTATEN: Weizenmehl, Eier, Butter (milch), Zucker, Chantilly Creme 10% (Zucker, Glucosesyrup, Wasser, Milchpulver, Butter (milch), Eigelb, Stabilisator: Pektin, Reisstaerke, Konservierungsmittel: Kaliumsorbat, Aromen), Wasser, Hefe (Weizen), Glukosesirup, Emulgator: Mono-Diglyzerid der Fettsâuren, Salz, Magermilchpulver, Kakaobutter, Aromen, Sâuerungsmittel: Sorbinsâure. Es kann Erdnuss, Schalenobstresten und Sesam und Soja enhalten. Enthâlt ein Tütchen mit Puderzucker (Zutaten: Zucker, Weizenstârke, Aromen: Vanillin). Das ist ein eingliedert Part des Produkt. (GB) OVEN-BAKED NATURALLY LEAVENED FILLED CONFECTIONERY PRODUCT - INGREDIENTS: Wheat flour, Eggs, Butter (milk), Sugar, Chantilly cream 1 0% (Sugar, Glucose syrup, Water, Milk powder, Butter (milk), Egg yolk, Stabilizer: pectin, Rice starch, Preservative: potassium sorbate, Flavourings), Water, Natural yeast (wheat), Glucose syrup, Emulsifier: mono-diglycerides of fatty acids, Salt, Skim milk powder, Cocoa butter, Flavourings, Preservative: sorbic acid. It may contain traces of peanuts, nuts, sesame and soya. Contains a sachet oficing sugar (Ingredients: Sugar, Wheat starch, Flavourings?. Vanillin). It\'s a product integrant part. (E) PRODUCTO CONFITERO DE HORNO DE FERMENTO NATURAL RELLENO - INGREDIENTES: Harina de trigo blando tipo Huevos, Mantequilla (leche), Azücar, Crema Chantilly 10% (Azücar, Glicosa, Agua, Leche en polvo, Mantequilla (leche), Yema de huevo, Estabilizante: pectina, Fecula de arroz, Conservante: sorbato de potasio, Aromas), Agua, Levadura natural (trigo), Jarabe de glucosa, Emulgente: mono y diglicéridos de los écidos grasos, Sal, Leche descremada en polvo, Manteca de cacao, Aromas, Conservante: acido s6rbico. Puede contener rastros de cacahuetes, fruta con céscara, sésamo y soja. Contiene un sobre de azücar en polvo (Ingredientes: Azücar, Almidén de trigo, que forma parte integrante dei producto. (RO) PRODUS DE PATISERIE CU DOSPIRE NATURALÀ UMPLUTURÀ - INGREDIENTE: Fàinà de grâu, oui Unt (lapte), Zahàr, Cremà Chantilly 1 0% (Zahàr, Sirop de glucozà, Apà, Melkpoeder, Unt (lapte), Galbenus de ou, Stabilizan!i: pectine, Amidon de orez, Conservant: sorbat de potasiu, Arome), Apà, Drojdie (grau), Sirop de glucozâ, Emulsificatori: mono si digliceride ale acizilor grasi, Sare, Lapte praf degresat, Unt de cacao, Arome, Conservant: acid sorbic. Poate contine urme de arahide, fructe in coaja, susan si soia. Con!ine un Plic de zahàr pudrà (Ingrediente: Zahàr, Amidon de grâu, Arome: vanilinà) ce face parte integrantà din produs.', 'https://static.openfoodfacts.org/images/products/800/497/013/4736/front_fr.4.400.jpg', '19.5', '12.3', '50.2', '26.7', '1.2', '6.1', '0.54', '0.21259842519685', '', '0');

